DROP TABLE IF EXISTS `선호관광지`;
DROP TABLE IF EXISTS `선호코스`;
DROP TABLE IF EXISTS `코스정보`;
DROP TABLE IF EXISTS `코스`;
DROP TABLE IF EXISTS `관광지`;
DROP TABLE IF EXISTS `테마`;

CREATE TABLE `테마`
(
    `테마분류`    CHAR(4) PRIMARY KEY,
    `테마명`    VARCHAR(100) NOT NULL
);

CREATE TABLE `코스`
(
    `코스ID`    INTEGER PRIMARY KEY
);

CREATE TABLE `선호코스`
(
    `코스ID`    INTEGER PRIMARY KEY,
	FOREIGN KEY (`코스ID`) REFERENCES `코스` (`코스ID`) ON UPDATE CASCADE
);

CREATE TABLE `관광지`
(
    `관광지ID`    INTEGER PRIMARY KEY,
    `지역ID`    VARCHAR(10) NOT NULL,
    `관광지명`    VARCHAR(100) NOT NULL,
    `경도`    DECIMAL(11,7) NOT NULL,
    `위도`    DECIMAL(11,8) NOT NULL,
    `실내구분`    CHAR(6) NOT NULL,
    `테마분류`    CHAR(4) NOT NULL,
	FOREIGN KEY ( `테마분류` ) REFERENCES `테마` (`테마분류`) ON UPDATE CASCADE
);

CREATE TABLE `코스정보`
(
	`관광지ID`    INTEGER,
    `코스ID`    INTEGER,
    `코스순서`    TINYINT,
    `이동시간`    TINYINT,
    PRIMARY KEY (`관광지ID`, `코스ID`),
    FOREIGN KEY (`관광지ID`) REFERENCES `관광지` (`관광지ID`) ON UPDATE CASCADE,
    FOREIGN KEY (`코스ID`) REFERENCES `코스` (`코스ID`) ON UPDATE CASCADE
);

CREATE TABLE `선호관광지`
(
    `관광지ID`    INTEGER PRIMARY KEY,
 FOREIGN KEY (`관광지ID`) REFERENCES `관광지` (`관광지ID`) ON UPDATE CASCADE
);

